import React from 'react'
import { useState } from 'react'

const Resume = () => {

    const [readMore, setReadMore] = useState([false])

    const onClick = (e) => {
        e.preventDefault()
        e.target.setReadMore(!readMore)
    }

    const text1 = "Time for a real applications and deep documentation with rich content. Then i learned Nodejs, Expressjs, Passportjs and Mongodb. I went through it with pleasure and i hope to find a company to share my skills. Time for a real applications and deep documentation with rich content. Then i learned Nodejs, Expressjs, Passportjs and Mongodb. I went through it with pleasure and i hope to find a company to share my skills.";
    const text2 = "Then JavaScript and React came on time to get more understanding of web development.";
    const text3 = "I started to learn coding and appreciate to discover new skills, it was the beginning for an amazing coding experience. It is tough for a swimming teacher but with motivation i kept going.";
    const text4 = "I worked for 5 years in pools, spa, hotels and sport centers. That was a really good experience and training, but i decided to change my activity when the Covid came and close everything.";
    return (

        <div id="experiencesId" className="box-timeline">         

            <div className="box b1" data-anim="1">
                <h5>Full Stack Engineer<br/>2021</h5>
                <p>{readMore ? text1 : `${text1.substring(0, 100)}...`}
                <button className="btn-readmore" onClick={onClick}>{readMore ? "show less" : "read more"}</button></p>
                <a href="https://www.codecademy.com/profiles/Arnaud-ca-dev" target='_blank' rel='noreferrer' alt="timeline" className="btn">www.Codecademy.com</a>
            </div>

            <div className="box b2" data-anim="2">
                <h5>JavaScript and React <br/>2020-2021 </h5>
                <p>{readMore ? text2 : `${text2.substring(0, 100)}...`}
                <button className="btn-readmore" onClick={() => {setReadMore(!readMore)}}>{readMore ? "show less" : "read more"}</button></p>
                <a href="https://www.codecademy.com/profiles/Arnaud-ca-dev" target='_blank' rel='noreferrer' alt="timeline" className="btn">www.Codecademy.com</a>
            </div>
            <div className="box b3" data-anim="3">
                <h5> Html, and Css <br/> 2020</h5>
                <p>{readMore ? text3 : `${text3.substring(0, 100)}...`}
                <button className="btn-readmore" onClick={() => {setReadMore(!readMore)}}>{readMore ? "show less" : "read more"}</button></p>
                <a href="https://www.codecademy.com/profiles/Arnaud-ca-dev" target='_blank' rel='noreferrer' alt="timeline" className="btn">www.Codecademy.com</a>
            </div>
            <div className="box b4" data-anim="4">
                <h5>Swimming teacher and Aquafitness instructor <br/>2016-2020</h5>
                <p>{readMore ? text4 : `${text4.substring(0, 100)}...`}
                <button className="btn-readmore" onClick={() => {setReadMore(!readMore)}}>{readMore ? "show less" : "read more"}</button></p>
            </div>

        </div>
    )
}

export default Resume;
